import React, { useState } from "react";
const Index = () => {
  const [num, setNum] = useState(1);
  const [error, setError] = useState(false);
  const handle2 = () => {
    setNum(num + 2);
    if (num < 0 && num > 100) {
      setError(false);
    }
  };
  return (
    <div>
      <h1>{num}</h1>
      <button onClick={handle2}>+2</button>
      <button>*5</button>
      <button>-1</button>
      <button>+8</button>
    </div>
  );
};
export default Index;
